The major storyline for the fourth season concerns a team recruited by Homeland Security agent Don Self (Michael Rapaport) to obtain Scylla. Although the team initially believes it to be the Company's &quot;black book&quot;, it is later revealed to contain information on an advanced renewable power cell. Over the course of the first half of the season, the team obtain cards to access Scylla, and break into Company headquarters to steal it. In the first half, Sara is discovered to be alive, Bellick is killed, and Self is revealed to be a double agent and is planning to sell Scylla to the highest bidder. Reluctantly, Lincoln decides to join the Company to get it back, while Michael suffers from a brain aneurysm. He is treated and operated on by the Company. He later learns that his mother, Christina is still alive and was an agent of the Company, who is revealed to acquire Scylla to sell to the highest bidder. Eventually, the series ends in Miami, where Scylla is recovered by Michael and the team, the General and the Company are taken down, and Christina is killed. In Prison Break: The Final Break, a story is told explaining what happened following the events of the last episode (before the four-year flash-forward) and the strange scar on Sara's shoulder. This story involves the incarceration of Sara in Miami-Dade county penitentiary due to budgetary cutbacks; there are cots installed there acting as the county jail. With the General and T-Bag in the adjacent Men's facility, the General wants Sara dead and offers a $100,000 bounty. Largely echoing season one, Sara is involved in common prison fare before Michael hears of the bounty, and plans are devised for her escape.


